import Header from "./Commons/Header";

import Login from "./Login/login"

import '../css/App.css';


class Init extends Component {
  render() {
    return (
      <div>
        <Header></Header>
        <div>
          <div  >
            <Login></Login>
          </div>
        </div>
        <div className="footer border-top shadow">
          <div>
            footer
        </div>
        </div>

      </div>
    )
  }
  ;
}

export default Init;
